define(["angular"],function(angular){var app;try{app=angular.module("cpanel.jetbackup")}catch(e){app=angular.module("cpanel.jetbackup",[])}app.directive("focusInput",["$timeout",function($timeout){return function(scope,element,attrs){scope.$watch(attrs.focusInput,function(newValue){$timeout(function(){newValue&&element.focus()})},true)}}])});